import React from 'react'
import './RotatingCarousel.css'
import {Carousel} from '3d-react-carousal';
import RC1 from './images/carousel images/RC1.png'
import RC2 from './images/carousel images/RC2.png'
import RC3 from './images/carousel images/RC3.png'
import RC4 from './images/carousel images/RC4.png'
import RC5 from './images/carousel images/RC5.png'


function RotatingCarousel() {
    let slides = [
        <img src= {RC1} alt="1" />,
        <img src= {RC2} alt="2" />,
        <img src= {RC3} alt="3" />,
        <img src= {RC4} alt="4" />,
        <img src= {RC5} alt="5" />,
    ];
    return (
        <div className="rotating_carousel">
            <Carousel slides={slides} autoplay={true} interval={100}/>
        </div>
    )
}

export default RotatingCarousel
